export const ModalCancel = () => {
	return (
		<svg
			width={10}
			height={10}
			viewBox="0 0 10 10"
			fill="none"
			xmlns="http://www.w3.org/2000/svg"
		>
			<path
				d="M1 9L9 1"
				stroke="#C1C1C1"
				strokeWidth={2}
				strokeLinecap="round"
				strokeLinejoin="round"
			/>
			<path
				d="M9 9L1 1"
				stroke="#C1C1C1"
				strokeWidth={2}
				strokeLinecap="round"
				strokeLinejoin="round"
			/>
		</svg>
	);
};
